(91540, 307076, 7948, 1, '無夢 Hopeless', '關於失去\n有人可以轉身就忘\n有人需要時間淡化傷痛\n但也有人\n終其一生都無法面對\n情願用想念慢慢地描繪記憶裡的容顏\n\n這首歌\n想述說的就是這樣的一份執念\n因為不想忘\n所以心甘情願的把記憶背負著\n因為不能忘\n所以放任眼中的世界失去溫度\n因為日子一樣要過\n所以只能在一個人獨處的時候流淚....', '2014-09-30 00:00:00', 2000, 19, 0, 4, '冷冷的風  吹對東邊過\n冷冷的雨  無情的落歸瞑\n冷冷的燈  伴著阮置這坐\n一瞑風雨  一瞑無話  \n\n冷冷的月  不知走去叨       \n冷冷的星  哪會攏無地找   \n冷冷的茶  有誰人飲會落\n阮的愛像斷線的風吹\n\n惦這個冷冷的世間\n這款的日子  這款的思念是絕望\n阮嘸知  天若光有啥不同  \n若無你  阮的人生就攏沒滋味\n\n冷冷的歌  何時唱會煞 \n冷冷的詩  要唸乎誰人聽 \n純情的夢  尚驚夢醒成空\n阮付出的愛  全然  無望\n\n\n冷冷的月  不知走去叨       \n冷冷的星  哪會攏無地找   \n冷冷的茶  有誰人飲會落\n阮的愛像斷線的風吹\n\n惦這個冷冷的世間\n這款的日子  這款的思念是絕望\n阮嘸知  天若光有啥不同  \n若無你  阮的人生就攏沒滋味\n\n冷冷的情  還是不願放\n冷冷的心  等袂到一世人       \n愛擱卡重  到最後攏成空     \n無你的世間  冷冷  無夢', '', 283, '', '陳彥寧 Elaine', '陳彥寧 Elaine / 花戀蝶 Fanny', '牙牙 Yar Wu', '99 Music Studio', '', 0, 1, 0, '2014-10-22 21:00:09', '2015-03-12 14:16:31', '0000-00-00 00:00:00'),
(91541, 160205, 7949, 1, '在那片星空', '', '2014-05-11 00:00:00', 2000, 11, 0, 6, '在那片星空\n作曲 / 作詞 / 監製：陳蔚琦 @ Electone Music\n編曲 : 譚天樂\n\nMixed by 宋嘉恆\nVocal produced by 譚天樂\nAll guitars by 陳蔚琦 @ Electone Music\nKeys and programming by 譚天樂\nISRC：HKD081300008\n\nVerse 1 \n在這平靜的海邊 你點起了香煙\n想起從前呼吸的感覺 和現在的改變\n喝着Whisky 要用酒精去放下一切\n我們播放着音樂 煩惱疲倦不見\n\nPre-chorus\nOhhh 真正的在享受歲月\nOhhh突然間發現 好久沒嘗過這種體驗\n\nChorus \n在那片星空 我想起最初那個夢\n在那片星空 我找回那沒包袱的輕鬆\n生活中的痛 全都瞬間失重\n把那些塞掉的脈搏都打通\n\n在那片星空 我想起最初那個夢\n在那片星空 我找回那臉上該有的歡容\n生命的時鐘 永遠不能掌控\n所以就算拼命的衝 \n也不要忘了把快樂繼續栽種\nRepeat Pre-chorus\n\nChorus \n在那片星空 我想起最初那個夢\n在那片星空 我找回那沒包袱的輕鬆\n生活中的痛 全都瞬間失重\n把那些塞掉的脈搏都打通\n\n在那片星空 我想起最初那個夢\n在那片星空 我找回那臉上該有的歡容\n生命的時鐘 永遠不能掌控\n所以要記住這分鐘\n\nCoda\n在那片星空 我想起最初那個夢\n在那片星空 我找回那臉上該有的歡容\n生命的時鐘 總有天不再動\n所以就算拼命的衝\n也不要忘了把快樂繼續栽種', '', 258, '', '', '', '', '陳蔚琦', '', 0, 1, 0, '2014-10-23 06:26:38', '2015-03-12 14:16:31', '0000-00-00 00:00:00'),
