(91544, 159121, 6003, 12, '逃脫', '', '2013-08-07 00:00:00', 2000, 19, 2, 6, '我過得並不好 你也許 不會知道\n我的心像一座 沒有人 的孤島\n心情完全顛倒 找不到心的依靠\n你的靈魂出走 留下我 一人難熬\n\n我受夠被困在這監牢\n我的難過沒有人知道 我想逃\n\n已決心 要把回憶上鎖 \n就別再去為自己找藉口\n拜託 我多麼想從記憶中逃脫\n我停止 繼續做白日夢\n已放棄 等待你回頭\n\n我懂 我只是一時被愛昏了頭\n我不真的還眷戀你的溫柔\n\n黑夜裡有月光陪我\n迷了路有燈塔守候\n我不害怕孤獨 我不會放聲大哭\n', '', 207, '', '', '', '', '陳鈺羲（青鳥合唱團 The Bluebird)', '', 0, 1, 0, '2014-10-23 13:44:35', '2015-03-12 14:16:31', '0000-00-00 00:00:00'),
