(91546, 25812, 0, 1, '時間都去哪兒了', '', '2014-10-23 00:00:00', 2000, 19, 2, 4, '門前老樹長新芽\n院裡枯木又開花\n半生存了好多話\n藏進了滿頭白髮\n\n記憶中的小腳丫\n肉嘟嘟的小嘴巴\n一生把愛交給他\n只為那一聲爸媽\n\n時間都去哪兒了\n還沒好好感受年輕就老了\n生兒養女一輩子\n滿腦子都是孩子哭了笑了\n\n時間都去哪兒了\n還沒好好看看你眼睛就花了\n柴米油鹽半輩子\n轉眼就只剩下滿臉的皺紋了', '', 178, '', '', '', '', '想念', '', 0, 1, 0, '2014-10-23 20:40:40', '2015-03-12 14:16:31', '0000-00-00 00:00:00'),
