(91566, 317216, 7627, 4, '幸福的顏色', '\n幸福是甚麼顏色？\n幸福是怎樣的感覺？\n每個人對於幸福的定義都不同，用歌曲用文字用聲音用旋律用節奏，能不能將幸福的模樣做清楚的描述？\n在這首歌裡，袁惟仁依舊用他擅長的音樂風格配上如詩般的文字，帶著淡淡的感傷，又清晰又飄渺的對幸福做了最完美的詮釋。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 211, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-24 14:01:17', '2015-03-12 14:16:32', '0000-00-00 00:00:00'),
(91567, 317216, 7627, 5, '我的朋友', '簡單的吉他加上弦樂，輕鬆跳躍的音符彷彿是袁惟仁對朋友的問候。\n這些年來往返華人地區，飛來飛去，總是在一地停留幾天又要趕往下一個行程。\n認識了很多人，留下了一些故事，有的開心有的也許遺憾。\n『當空服員問我 你要點些甚麼 \n  而我回答他 我說我想回家』\n或許，家所代表的不只是親情，還是友情，更代表了小胖老師對所有情感交流的關心和付出。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 227, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-24 14:04:13', '2015-03-12 14:16:32', '0000-00-00 00:00:00'),
(91568, 317216, 7627, 6, '幸福', '名為幸福卻是遺憾一首歌。\n襯著始終若遠若近的弦樂，袁惟仁娓娓道來感情世界的無奈。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 213, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-24 14:07:44', '2015-03-12 14:16:32', '0000-00-00 00:00:00'),
(91569, 317216, 7627, 7, '香港愛情故事', '\n在這張專輯中，袁惟仁唱了不同地方的感情。\n東區那條巷子、聽說你在上海，香港愛情故事堪稱是他的城市三部曲。\n每個地方的感情都不同，對於城市的描述躍然紙上，因為不同城市的生活步調而有了不同的感情觀和面貌。\n和袁惟仁結緣於『快樂男聲』的陳楚生，某次在選秀後台，看到小胖老師永遠隨身帶著吉他，儘管忙碌仍在創作音樂，除了感到佩服之外，更在聽到他哼唱的旋律當下，就驚艷說著：『老師，將來這首歌要是寫出來，一定要留給我唱！！』袁惟仁笑笑看著當時仍在比賽的陳楚生，只簡單的說：『加油，我等你。』\n當年稚嫩的比賽選手如今已是紅遍華人世界被譽為華語歌壇最具影響力的男歌手之一，小胖老師當時哼唱的旋律後來寫成了『香港愛情故事』，他也信守承諾的將這首歌留給陳楚生，邀他一起來合唱。\n', '2014-10-21 00:00:00', 2000, 25, 0, 4, '', '', 361, '', '', '', '', 'Sony Music', '', 0, 1, 0, '2014-10-24 14:10:44', '2015-03-12 14:16:32', '0000-00-00 00:00:00');
